import React, { useState } from 'react';
import { Header } from '../../components/Header';
import { FormularioEmpresa } from './FormularioEmpresa';
import { FormularioEmpreendedor } from './FormularioEmpreendedor';
import { Logoform}  from '../../components/logo';

export const Register = () => {
  const [showEmpresaForm, setShowEmpresaForm] = useState(false);
  const [showEmpreendedorForm, setShowEmpreendedorForm] = useState(false);

  const handleShowEmpresaForm = () => {
    setShowEmpresaForm(true);
    setShowEmpreendedorForm(false);
  };

  const handleShowEmpreendedorForm = () => {
    setShowEmpreendedorForm(true);
    setShowEmpresaForm(false);
  };

  return (
    <>
      <Header />
      <section className='mt-32 md:mt-4 lg:mt-0'>
        <div className="min-h-screen bg-gray-900 flex flex-col items-center justify-center">
            <div className="flex justify-center">
                <Logoform className="w-10 h-10" /> 
            </div> 
          <h2 className="text-2xl font-bold text-white mb-6">Registro de Usuário</h2>

          <div className="flex gap-4 mb-4">
            <button
              onClick={handleShowEmpresaForm}
              className={`bg-blue-500 hover:bg-blue-600 text-white font-bold py-2 px-4 rounded focus:outline-none focus:shadow-outline ${showEmpresaForm ? 'bg-gray-600 cursor-not-allowed' : ''}`}
              disabled={showEmpresaForm}
            >
             Empresa
            </button>
            <button
              onClick={handleShowEmpreendedorForm}
              className={`bg-blue-500 hover:bg-blue-600 text-white font-bold py-2 px-4 rounded focus:outline-none focus:shadow-outline ${showEmpreendedorForm ? 'bg-gray-600 cursor-not-allowed' : ''}`}
              disabled={showEmpreendedorForm}
            >
             Empreendedor
            </button>
          </div>

          {/* Renderizar o formulário correspondente */}
          {showEmpresaForm && <FormularioEmpresa />}
          {showEmpreendedorForm && <FormularioEmpreendedor />}

        </div>
      </section>
    </>
  );
};
